	private boolean hasMadeChest;

	public CorbaVillageHouse2() {}

	public CorbaVillageHouse2(StructureCorbaVillagePieces.Start start, int type, Random rand, StructureBoundingBox boundingBox, EnumFacing facing) {
		super(start, type);
		this.setCoordBaseMode(facing);
		this.boundingBox = boundingBox;
	}

	public static CorbaVillageHouse2 createPiece(StructureCorbaVillagePieces.Start start, List<StructureComponent> component, Random rand, int x, int y, int z, EnumFacing facing, int var1) {
		StructureBoundingBox structureboundingbox = StructureBoundingBox.getComponentToAddBoundingBox(x, y, z, 0, 0, 0, 10, 6, 7, facing);
		return canVillageGoDeeper(structureboundingbox) && StructureComponent.findIntersecting(component, structureboundingbox) == null ? new CorbaVillageHouse2(start, var1, rand, structureboundingbox, facing) : null;
	}

	@Override
	protected void writeStructureToNBT(NBTTagCompound tagCompound) {
		super.writeStructureToNBT(tagCompound);
		tagCompound.setBoolean("Chest", this.hasMadeChest);
	}

	@Override
	protected void readStructureFromNBT(NBTTagCompound tagCompound, TemplateManager manager) {
		super.readStructureFromNBT(tagCompound, manager);
		this.hasMadeChest = tagCompound.getBoolean("Chest");
	}

	public IBlockState chooseRandomBrick() {
		return RandHelper.chooseEqual(new Random(), JourneyBlocks.corbaCrackedBricks.getDefaultState(), JourneyBlocks.corbaBricks.getDefaultState(), JourneyBlocks.corbaDarkBricks.getDefaultState(), JourneyBlocks.corbaLightBricks.getDefaultState());
	}
	
